import pytest
from httpx import AsyncClient
from app import app


@pytest.mark.asyncio
async def test_meme():
    async with AsyncClient(app=app, base_url="http://testserver") as ac:
        data = {"title": "Test Meme", "image_url": "data:image/jpeg;base64,"}
        response = await ac.post("/api/v1/private_memes", json=data)
        assert response.status_code == 201
        assert response.json()['title'] == "Test Meme"
        meme_id = response.json()["id"]
        response = await ac.get("/api/v1/memes")
        assert response.status_code == 200

        response = await ac.get("/api/v1/memes/1")
        assert response.status_code == 200

        data = {"title": "Test", "image_url": "http://example.com/original.jpg"}
        response = await ac.put(f"/api/v1/private_memes/{meme_id}", json=data)
        assert response.status_code == 200
        assert response.json()['title'] == "Test"

        response = await ac.delete(f"/api/v1/private_memes/{meme_id}")
        assert response.status_code == 200

